import React from 'react';
import Grid from 'react-bootstrap/es/Grid';
import Card from 'pnnl-react-core/lib/Card';
import Button from 'react-bootstrap/es/Button';
import Examples from './Examples';
import ProfilePopover from 'pnnl-react-core/lib/ProfilePopover';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';


const Calc = ({ me }) => {
  if (me.id){
    return(
  <Grid>
    <h1>IES TM30 Calculator</h1>
    <br />
    <Card>
      <h2>A</h2>
      <form>
        <label>
          User:
          <ProfilePopover person={me} />
        </label>
        <br />
        <label>
          Commercial:
          <select id="Commercial" name="Commercial">
            <option value="one">1</option>
            <option value="two">2</option>
            <option value="three">3</option>
          </select>
        </label>
        <br />
        <label>
          Example:
        <Examples />
        </label>
        <br />
        <Button bsSize="sm">Calculate</Button>
      </form>
    </Card>
    <br />
    <Card>
    <form>
    <h2>B</h2>
      <label>
        Import .spdx file
        <input type="file" />
      </label>
      </form>
    </Card>
<br />
    <Card>
      <h2>C</h2>
      <form>
        <label>
          Start Wavelength (nm): 
          <br />
          <input></input>
        </label>
        <br />
        <label>
          End Wavelength (nm): 
          <br />
          <input></input>
        </label>
        <br />
        <label>
          Interval (nm): 
          <br />
          <input></input>
        </label>
        <br />
        <Button bsSize="sm">Calculate</Button>
      </form>
      </Card>

  </Grid>
   );
  }
};

Calc.propTypes = {
  /**
    * A Person object for the person you want to create the card for.
    *
    *
    * The object needs to have the same naming convention as: https://api.pnl.gov/operations/v2/people/{hid}/?expand=space,facility
    * */
  me: PropTypes.shape({
    id: PropTypes.string,
    portraitLink: PropTypes.string,
    firstName: PropTypes.string,
    lastName: PropTypes.string,
    title: PropTypes.string,
  }),
};

Calc.defaultProps = {
  me: {},
};

const mapStateToProps = (state) => {
  const { me } = state;
  return {
    me,
  };
};

export default connect(mapStateToProps)(Calc);
